clear; close all; clc; 

r0 = [3500 -2000 1500]';
rdot0 = [-75 0 100]';
rf = [0 -100 -1000]';

lb = r0(1) / abs(rdot0(1));
ub = 400 / (4.53*10^-4 * 6 * 0.3 * 3100 * cos(deg2rad(27)));
tol = 5e-1;

[opt_t_f, optval, state_history, thrust_history] = gss(lb, ub, tol, r0, rdot0, rf); %[output:296abbb0]
%%
figure(1) %[output:88647f85]
trajectory = tiledlayout(1, 1, "TileSpacing", "compact", "Padding", "compact"); %[output:88647f85]
set(gcf, 'Position', [100 100 800 800]) %[output:88647f85]
nexttile %[output:88647f85]
plot3(state_history(3,:), state_history(2,:), state_history(1,:), 'Color', 'black') %[output:88647f85]
grid on; axis equal; %[output:88647f85]
hold on; %[output:88647f85]
plot3(r0(3), r0(2), r0(1), 'o', 'MarkerSize', 5) %[output:88647f85]
plot3(state_history(3, end), state_history(2, end), state_history(1, end), '.', 'MarkerSize', 15) %[output:88647f85]
xlabel('$z$ [m]') %[output:88647f85]
ylabel('$y$ [m]') %[output:88647f85]
zlabel('$x$ [m]') %[output:88647f85]
delta_t = opt_t_f/size(state_history, 2);
N = size(state_history, 2) - 1;
tspan = 0:delta_t:N*delta_t;

figure(2) %[output:0c560eeb]
state_plot = tiledlayout(3, 1, "TileSpacing", "compact", "Padding", "compact"); %[output:0c560eeb]
set(gcf, "Position", [100 100 1500 1000]) %[output:0c560eeb]

nexttile %[output:0c560eeb]
plot(tspan, state_history(1,:), 'r', tspan, state_history(2, :), 'g', tspan, state_history(3, :), 'b') %[output:0c560eeb]
ylabel('$r(t)$') %[output:0c560eeb]
grid on %[output:0c560eeb]
legend('$x$', '$y$', '$z$') %[output:0c560eeb]

nexttile %[output:0c560eeb]
plot(tspan, state_history(4,:), 'r', tspan, state_history(5, :), 'g', tspan, state_history(6, :), 'b') %[output:0c560eeb]
ylabel('$\dot{r}(t)$') %[output:0c560eeb]
grid on %[output:0c560eeb]
legend('$\dot{x}$', '$\dot{y}$', '$\dot{z}$') %[output:0c560eeb]

nexttile %[output:0c560eeb]
hold on %[output:0c560eeb]
plot(tspan, thrust_history(1, :), 'r', tspan, thrust_history(2, :), 'g', tspan, thrust_history(3, :), 'b') %[output:0c560eeb]
ylabel('$u(t)$') %[output:0c560eeb]
xlabel('Time [s]') %[output:0c560eeb]
grid on %[output:0c560eeb]
legend('$u_x$', '$u_y$', '$u_z$') %[output:0c560eeb]
%[text] 
function [opt_t_f, optval, state_history, thrust_history] = gss(lb, ub, tol, r0, rdot0, rf)
    gr = (sqrt(5) - 1)/2;
    d = gr * (ub - lb);
    
    x1 = lb + d;
    x2 = ub - d;
    
    while d > tol
        [x1_status, x1_optval, ~] = solve_fuel_optimal(r0, rdot0, rf, x1);
        [x2_status, x2_optval, ~] = solve_fuel_optimal(r0, rdot0, rf, x2);
    
        if strcmp(x1_status, 'Infeasible')
            x1_optval = 10^6;
        end
    
        if strcmp(x2_status, 'Infeasible')
            x2_optval = 10^6;
        end
    
        formatSpec = 'lb = %f, x1 = %f (%f), x2 = %f (%f), ub = %f\n';
        fprintf(formatSpec, lb, x1, x1_optval, x2, x2_optval, ub)
    
        if x1_optval < x2_optval
            lb = x2;
            d = gr * (ub - lb);
            x2 = x1;
            x1 = lb + d;
        elseif x1_optval > x2_optval
            ub = x1;
            d = gr * (ub - lb);
            x1 = x2;
            x2 = ub - d;
        end
    end
    
    opt_t_f = (x1 + x2)/2;
    fprintf('Optimal t_f: %f [s]', opt_t_f)
    [~, optval, state_history, thrust_history] = solve_fuel_optimal(r0, rdot0, rf, opt_t_f);
end

